module Program =

    let uncurry2 f = fun x y -> f (x, y)

    let exponentially = float >> (uncurry2 Math.Pow 2) >> TimeSpan.FromSeconds

    //let myCustomFunction (logger: ILogger) =
    //    logger.Information("My custom function is called")
